    false,nt"url": null,nt"notes": "This annual narrative report for Necedah
    National Wildlife Refuge outlines Refuge accomplishments during the 1993 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, compliance with environmental and cultural
    resource mandates, research, and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, haying, fire management,
    water rights, wilderness areas, and private lands. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds, waterbirds, shorebirds, raptors, game mammals, fisheries resources, animal
    control, and marking and banding. The public uses of the Refuge described in this
    report include interpretive programs, hunting, fishing, trapping, wildlife observation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, communication systems, computer systems, and energy conservation. Cooperative
    programs, economic uses of the Refuge, and items of interest are provided at the
    end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
